import { GetTenantOwnerDetailsResponse } from "./GetTenantDomainResponse";
/**
 * @export
 * @interface GetUserProductDetailsResponse
 */
export interface GetUserProductDetailsResponse {
    /**
     * Indicates if the domain is valid
     * @type {boolean}
     */
    IsDomainValid: boolean;
    /**
     * Indicates if the email is valid
     * @type {boolean}
     */
    IsEmailValid: boolean;
    /**
     * Indicates if the product is valid against the domain
     * @type {boolean}
     */
    IsProductValidAgainstDomain: boolean;
    /**
     * Indicates if the product is valid against the user
     * @type {boolean}
     */
    IsProductValidAgainstUser: boolean;
    /**
     * Indicates if the authentication type is valid against the domain
     * @type {boolean}
     */
    IsAuthenticationValidAgainstDomain: boolean;
    /**
     * Owner details associated with the domain and product
     * @type {GetTenantOwnerDetailsResponse}
     */
    OwnerDtl: GetTenantOwnerDetailsResponse;
}
